class Solution {
  int specialPerm(List<int> nums) {
    final int mod = 1000000007;
    int n = nums.length;
    List<List<int>> dp = List.generate(1 << n, (_) => List.filled(n, 0));
    for (int i = 0; i < n; i++) dp[1 << i][i] = 1;

    for (int mask = 0; mask < (1 << n); mask++) {
      for (int last = 0; last < n; last++) {
        if ((mask & (1 << last)) == 0) continue;
        int prevMask = mask ^ (1 << last);
        for (int prev = 0; prev < n; prev++) {
          if ((prevMask & (1 << prev)) == 0) continue;
          if (nums[last] % nums[prev] == 0 || nums[prev] % nums[last] == 0) {
            dp[mask][last] = (dp[mask][last] + dp[prevMask][prev]) % mod;
          }
        }
      }
    }

    int ans = 0;
    for (int i = 0; i < n; i++) {
      ans = (ans + dp[(1 << n) - 1][i]) % mod;
    }
    return ans;
  }
}
